import React , { Component }from 'react'
import { theUrl } from 'selfConfig'
import { connect } from 'react-redux'

const getList = (dispatch, url) => {
        fetch(url)
        .then(res => { return res.json() })
        .then(res => {
            dispatch({
                type: 'INIT',
                res
            })
            console.log(res)
        })
}

const List = (props) => {
    const getAdminList = theUrl+'/getAdminList'

    getList(props.dispatch, getAdminList)

    return (
        <div>
            <h1>Admin Management</h1>
            <h2>Admin list</h2>
        </div>
    )
}

export default connect()(List)

